    false,nt"url": null,nt"notes": "This data set contains the Limit of 8(g)
    Zone line in ESRI Arc/Info export and Arc/View shape file formats for the BOEM Pacific
    Region. The 8(g) Zone lies between the Submerged Lands Act (SLA) boundary line and
    a line projected 3 nautical miles seaward of the SLA boundary line. Within this
    zone revenues are shared with the coastal state(s). Because GIS projection and topology
    functions can change or generalize coordinates, these GIS files are NOT an OFFICIAL
    record for the exact Submerged Lands Act Boundary.",nt"license_title": null,nt"extras":
